import React, { useState } from "react";
import { CgClose } from "react-icons/cg"
import productCategory from "../helpers/productCategory";
import { FaCloudUploadAlt } from "react-icons/fa";
import uploadImage from "../helpers/uploadImage";

const UploadProduct = ({
    onClose
}) => {
    const [data, setData] = useState({
        productName: "",
        brandName: "",
        category: "",
        productImage: [],
        description: "",
        price: "",
        selling:""
    })
    const [uploadProductImageInput,setUploadProductImageInput]=useState("")
    const handleOnChange = (e) => {
        
    }
    const handleUploadProduct = async(e) => {
        const file = e.target.files[0]
        setUploadProductImageInput(file.name)
        console.log("file", file);
        const uploadImageCloudinary = await uploadImage(file)
        setData((preve) => {
            return ({
                ...preve,
                productImage:[...preve.productImage,uploadImageCloudinary.url]
            }
            )
        })
        console.log("upload image", uploadImageCloudinary.url);
    }
    return <div className="fixed w-full  h-full bg-slate-200 bg-opacity-35 top-0 left-0 right-0 bottom-0 flex justify-center items-center">
        <div className="bg-white p-4 rounded w-full max-w-2xl h-full max-h-[80%] overflow-hidden">
            <div className="flex justify-between items-center">
                <h2 className="font-bold text-lg"> UploadProduct</h2>
                <div className="w-fit ml-auto text-2xl hover:text-red-600 cursor-pointer" onClick={onClose}>
                    <CgClose/>
                </div>
            </div>
            <form className="grid p-4 gap-2 overflow-y-scroll h-full">
                <label htmlFor="productName">Product Name:</label>
                <input type="text"
                    id="productName"
                    placeholder="enter product name"
                    name="productName"
                    value={data.productName}
                    onChange={handleOnChange}
                    className="p-2 bg-slate-100 border rounded" />
                <label htmlFor="brandName" className="mt-3">Brand Name:</label>
                <input type="text"
                    id="brandName"
                    placeholder="enter brand name"
                    value={data.brandName}
                    onChange={handleOnChange}
                    className="p-2 bg-slate-100 border rounded" />
                <label htmlFor="category" className="mt-3">Category:</label>
                <select value={data.category} className="p-2 bg-slate-100 border rounded" >
                    {
                        productCategory.map((el, index) => {
                            return (
                                <option value={el.value} key={el.value+index}>{el.label}</option>
                            )
                        })
                    }
                </select>
                <label htmlFor="productImage" className="mt-3">product Image:</label>
                <label htmlFor="uploadImageInput">
                <div className="p-2 bg-slate-100 border rounded h-32 w-full flex justify-center items-center cursor-pointer">
                    
                    
                        <div className="text-slate-500 flex justify-center items-center flex-col gap-2">
                        <span className="text-4xl"><FaCloudUploadAlt /></span>
                        <p className="text-sm">upload product image</p>
                        <input type="file" id="uploadImageInput" className="hidden" onChange={handleUploadProduct}/>
                        </div>
                       
                    

                    </div>
                     </label>
                <div>
                    {
                        data?.productImage[0] ? (
                            <div className="flex items-center gap-2">
                                {
                                    data.productImage.map(el => {
                                return (
                                    <img src={el} alt='el' width={80} height={80} className="bg-slate-100 border"/>
                                )
                            })
                                }
                                </div>
                            
                        ) : (
                                <p className="text-red-600 text-xs">please upload the product</p>
                        )
                    }
                    
                </div>
                <button className="px-3 py-2 bg-red-600 text-white mb-10 hover:bg-red-700">upload product</button>
            </form>
             
        </div>
      
    </div>;
};

export default UploadProduct;
